import { Route, Switch } from 'react-router-dom';
import './App.css';
import Inicial from './Inicial';
import MyComponent from './MyComponent';

function App() {
  return (
        <div className="App">
          <Switch>
        <Route component={ Inicial } exact path="/" />
        <Route component={ MyComponent } exact path="/path" />
      </Switch>
        </div>
  );
}

export default App;
